INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 100101, 0, 1, "ヒヨリ", 100101, 7, 0, 200, 0, 2.295, 100101, 1, "ひより", "2030/12/31 15:00:00", 0, 1, 450, 0, "2015/04/01 15:00:00", 100101, "【物理】前衛で、敵前線を押し返す笑顔の元気娘。\n前衛に対して大ダメージを与えるユニオンバーストと、\n自身の攻撃力を強化するスキルを持つ攻撃役。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 100201, 0, 1, "ユイ", 100201, 7, 0, 800, 0, 2.27, 100201, 7, "ゆい", "2030/12/31 15:00:00", 0, 7, 450, 0, "2015/04/01 15:00:00", 100201, "【魔法】最後衛から、味方の回復と補助を行う魔法士。\n打たれ弱いが高い魔法攻撃力を持ち、ランクを上げると\n攻撃も補助もバランスよくこなせるようになる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 100301, 0, 1, "レイ", 100301, 7, 0, 250, 0, 1.965, 100301, 4, "れい", "2030/12/31 15:00:00", 0, 4, 450, 0, "2015/04/01 15:00:00", 100301, "【物理】前衛で、一点突破で敵を討つ、孤高の剣士。\nユニオンバースト、スキル共に眼前の敵を倒す事に優れ、\n高火力の攻撃スキルを駆使して前線を押し上げる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 100401, 0, 1, "ミソギ", 100401, 13, 0, 205, 0, 2.17, 100401, 1, "みそぎ", "2030/12/31 15:00:00", 0, 1, 450, 0, "2015/04/01 15:00:00", 100401, "【物理】最前衛で、敵の物理攻撃を邪魔するいたずら娘。\n目の前の敵を暗闇状態にし、命中率を大幅に下げるほか、\n敵一体の物理攻撃力を下げるスキルを持つ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 100501, 0, 2, "マツリ", 100501, 2, 0, 185, 0, 2.125, 100501, 2, "まつり", "2030/12/31 15:00:00", 0, 2, 450, 0, "2018/09/18 15:00:00", 100501, "【物理】前衛の、機敏な動きで敵をかき回す騎士見習い。\nユニオンバーストで相手の陣地の真ん中に飛び込み、\n自分の周囲を攻撃するスキルで相手を攻め立てる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 100601, 0, 2, "アカリ", 100601, 14, 0, 570, 0, 2.19, 100601, 6, "あかり", "2030/12/31 15:00:00", 0, 6, 450, 0, "2015/04/01 15:00:00", 100601, "【魔法】中衛で、魔法パーティの強化を担う、双子の妹。\n敵の魔法防御力を大幅に下げるスキルや、魔法攻撃力を\n上昇させ、回復効果を付与するユニオンバーストを使う。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 100701, 0, 2, "ミヤコ", 100701, 14, 0, 125, 0, 1.7, 100701, 3, "みやこ", "2030/12/31 15:00:00", 0, 3, 450, 0, "2015/04/01 15:00:00", 100701, "【物理】最前衛で、ひたすら敵の攻撃を避ける幽霊少女。\nスキルで幽霊に変身することで敵の攻撃を躱し、\nユニオンバーストでは敵をプリンにして食べてしまう。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 100801, 0, 2, "ユキ", 100801, 12, 0, 805, 0, 2.07, 100801, 21, "ゆき", "2030/12/31 15:00:00", 0, 7, 450, 0, "2015/04/01 15:00:00", 100801, "【魔法】後衛で物理パーティを補助する、歩く芸術作品。\n味方のユニオンバースト発動を早めるスキルのほか、\n暗闇状態にするスキルで敵の物理攻撃を封じる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 100901, 0, 3, "アンナ", 100901, 11, 0, 440, 0, 2.25, 100901, 5, "あんな", "2030/12/31 15:00:00", 0, 5, 450, 0, "2015/04/01 15:00:00", 100901, "【魔法】中衛から圧倒的な魔力で攻撃する、疾風の冥姫。\nユニオンバーストで敵全体に大ダメージを与えるが、\n高すぎる魔力の為、自分自身にも相応のリスクが生じる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 101001, 0, 3, "マホ", 101001, 4, 0, 795, 0, 2.27, 101001, 7, "まほ", "2030/12/31 15:00:00", 0, 7, 450, 0, "2015/04/01 15:00:00", 101001, "【魔法】後衛で味方のサポートを担当するメルヘン少女。\n味方全体を強化してＴＰを回復するユニオンバーストや、\nＨＰ回復、敵を暗闇にするスキルで戦況を好転させる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 101101, 0, 3, "リノ", 101101, 6, 0, 700, 0, 1.97, 101101, 8, "りの", "2030/12/31 15:00:00", 0, 8, 450, 0, "2015/04/01 15:00:00", 101101, "【物理】後衛から、矢の雨を降らせる妹系アーチャー。\nクリティカル率を高める重ね掛け可能なスキルを持ち、\nダメージ回数の多いユニオンバーストをより強力にする。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 101201, 0, 3, "ハツネ", 101201, 9, 0, 755, 0, 2.07, 101201, 7, "はつね", "2030/12/31 15:00:00", 0, 7, 450, 0, "2015/04/01 15:00:00", 101201, "【魔法】後衛の、対物理パーティが得意な超能力ガール。\nスキルが物理攻撃の敵に対して真価を発揮するため、\n物理攻撃型の敵パーティを一網打尽にする。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 101301, 0, 2, "ナナカ", 101301, 9, 0, 740, 0, 2.07, 101301, 7, "ななか", "2030/12/31 15:00:00", 0, 7, 450, 0, "2018/11/19 15:00:00", 101301, "【魔法】後衛から多彩な魔法を放つ、オタク魔法少女。\n体力が一番多い相手を狙うユニオンバーストやスキルは、\n敵のＨＰ状況により攻撃対象が変わる高威力の魔法攻撃。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 101401, 0, 3, "カスミ", 101401, 9, 0, 730, 0, 2.27, 101401, 21, "かすみ", "2030/12/31 15:00:00", 0, 7, 450, 0, "2019/02/28 12:00:00", 101401, "【魔法】後衛で、相手の行動妨害に特化した名探偵。\n束縛や混乱を付与するスキルで相手の行動を妨害し、\n魔法防御力ダウンのフィールドを展開して王手をかける。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 101501, 0, 2, "ミサト", 101501, 9, 0, 735, 0, 2.27, 101501, 9, "みさと", "2030/12/31 15:00:00", 0, 7, 450, 0, "2015/04/01 15:00:00", 101501, "【魔法】後衛で魔法キャラを支援する、みんなの先生。\nユニオンバーストのＨＰ回復＆魔防アップ、先頭キャラの\n継続ＨＰ回復スキルは、味方の耐久力を大幅に高める。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 101601, 0, 2, "スズナ", 101601, 15, 0, 705, 0, 1.97, 101601, 8, "すずな", "2030/12/31 15:00:00", 0, 8, 450, 0, "2015/04/01 15:00:00", 101601, "【物理】後衛からクリティカル攻撃するカリスマモデル。\nダメージ2倍のクリティカルダメージは\nスキルによる攻撃力アップでさらに破壊力を増す。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 101701, 0, 2, "カオリ", 101701, 4, 0, 145, 0, 2.17, 101701, 1, "かおり", "2030/12/31 15:00:00", 0, 1, 450, 0, "2015/04/01 15:00:00", 101701, "【物理】最前衛で、累積スキルでダメージを稼ぐ南国娘。\nスキル「精神統一」を発動すると、カオリが攻撃する度に\n敵に効果が累積し、次のダメージがどんどん増えていく。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 101801, 0, 3, "イオ", 101801, 15, 0, 715, 0, 2.6, 101801, 5, "いお", "2030/12/31 15:00:00", 0, 5, 450, 0, "2015/04/01 15:00:00", 101801, "【魔法】後衛で、敵全体を誘惑するセクシー先生。\n敵のＴＰを奪うスキルでユニオンバースト発動を遅らせ、\n誘惑のユニオンバーストを放ち、戦場を大混乱に陥れる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 102001, 0, 2, "ミミ", 102001, 13, 0, 360, 0, 2.125, 102001, 5, "みみ", "2030/12/31 15:00:00", 0, 5, 450, 0, "2015/04/01 15:00:00", 102001, "【物理】中衛で、敵前衛を崩す、うさぎっこ。\nユニオンバーストは、最も近い敵に大ダメージを与えた後\n隣の敵にも攻撃するので、前衛を早期に攻め落とせる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 102101, 0, 1, "クルミ", 102101, 3, 0, 240, 0, 1.675, 102101, 3, "くるみ", "2030/12/31 15:00:00", 0, 3, 450, 0, "2015/04/01 15:00:00", 102101, "【物理】前衛で、味方の守りに特化した、極度の照れ屋。\nスキルで自分の周囲の物理、魔法防御力を上げつつ、\n近くの敵をスタンさせて足止めする。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 102201, 0, 1, "ヨリ", 102201, 14, 0, 575, 0, 2.19, 102201, 6, "より", "2030/12/31 15:00:00", 0, 6, 450, 0, "2015/04/01 15:00:00", 102201, "【魔法】中衛から、強力な魔法で攻め立てる、双子の姉。\n自身のＨＰと引き換えに魔法攻撃力を増幅し、\nユニオンバーストやスキルの威力を高めて攻撃する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 102301, 0, 2, "アヤネ", 102301, 3, 0, 210, 0, 1.425, 102301, 3, "あやね", "2030/12/31 15:00:00", 0, 3, 450, 0, "2015/04/01 15:00:00", 102301, "【物理】前衛で、戦場をかき乱す、くまっ子。\nユニオンバーストで、相手を思い切り吹き飛ばすと同時に\nスタンと大ダメージを与えることで敵陣形を大きく乱す。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 102501, 0, 1, "スズメ", 102501, 3, 0, 720, 0, 2.27, 102501, 7, "すずめ", "2030/12/31 15:00:00", 0, 7, 450, 0, "2015/04/01 15:00:00", 102501, "【魔法】後衛で、回復と攻撃をこなすドジっ娘メイド。\n周りの味方のＨＰを回復しつつ物理攻撃力を高める\nスキルは、中衛・後衛の攻撃役と抜群の相性。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 102601, 0, 2, "リン", 102601, 3, 0, 550, 0, 2.34, 102601, 6, "りん", "2030/12/31 15:00:00", 0, 6, 450, 0, "2015/04/01 15:00:00", 102601, "【物理】中衛で物理パーティを強化するものぐさ少女。\n味方の物理攻撃力をアップしつつ、味方の魔法防御を\n高めることで攻守ともにパーティをサポートする。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 102701, 0, 2, "エリコ", 102701, 11, 0, 230, 0, 1.425, 102701, 3, "えりこ", "2030/12/31 15:00:00", 0, 3, 450, 0, "2015/04/01 15:00:00", 102701, "【物理】前衛で、毒スキルで敵を粉砕する、通称壊し屋。\n最高クラスの攻撃力を持ち、ユニオンバーストで敵に\nとどめの一撃を放つ毎に、その攻撃力はさらに上昇する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 102801, 0, 3, "サレン", 102801, 3, 0, 430, 0, 2.09, 102801, 4, "されん", "2030/12/31 15:00:00", 0, 4, 450, 0, "2015/04/01 15:00:00", 102801, "【物理】中衛で一発逆転を狙う、みんなのサレンママ。\nＨＰが下がるほどダメージが上昇するユニオンバーストと\n味方のＴＰを回復するスキルで、一気に形勢を逆転する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 102901, 0, 3, "ノゾミ", 102901, 10, 0, 160, 0, 1.965, 102901, 4, "のぞみ", "2030/12/31 15:00:00", 0, 4, 450, 0, "2015/04/01 15:00:00", 102901, "【物理】前衛で、皆の壁になって戦うアイドルのぞみん。\n彼女がステージに立てば、味方の物理攻撃力が\n大きくアップし、さらに敵の注意を一手に惹き付ける。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 103001, 0, 3, "ニノン", 103001, 12, 0, 415, 0, 2.25, 103001, 5, "にのん", "2030/12/31 15:00:00", 0, 5, 450, 0, "2015/04/01 15:00:00", 103001, "【物理】中衛で、強力な範囲攻撃を操る、忍術の使い手。\n範囲攻撃のスキルで敵を倒す事で、自分のＴＰを回復し、\n強力なユニオンバーストの発動頻度を上げる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 103101, 0, 2, "シノブ", 103101, 14, 0, 365, 0, 2.25, 103101, 5, "しのぶ", "2030/12/31 15:00:00", 0, 5, 450, 0, "2015/04/01 15:00:00", 103101, "【物理】中衛で、父親のドクロを召喚して戦う霊能少女。\n召喚した父親は、自分とは別に攻撃を行ってくれるほか、\nダメージを代わりに受けてくれることもある。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 103201, 0, 3, "アキノ", 103201, 8, 0, 180, 0, 2.125, 103201, 5, "あきの", "2030/12/31 15:00:00", 0, 5, 450, 0, "2015/04/01 15:00:00", 103201, "【物理】前衛で大暴れして攻める、令嬢剣士。\n自分の周りに、味方を回復するフィールドを作り出し、\n自ら前線を支え導く姿も、名家を背負う者のあるべき姿。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 103301, 0, 2, "マヒル", 103301, 5, 0, 395, 0, 2.34, 103301, 6, "まひる", "2030/12/31 15:00:00", 0, 6, 450, 0, "2015/04/01 15:00:00", 103301, "【物理】中衛で、相手の動きを乱す牧場主。\n敵前衛をノックバックさせることで、隊列を崩し、\n他のキャラが使う範囲攻撃の対象に敵を押し込む。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 103401, 0, 1, "ユカリ", 103401, 8, 0, 405, 0, 2.4, 103401, 5, "ゆかり", "2030/12/31 15:00:00", 0, 5, 450, 0, "2015/04/01 15:00:00", 103401, "【物理】中衛から、バリアや回復で味方を守る元聖騎士。\n傷ついた味方のＨＰやＴＰを回復するスキルを操り、\n打ち合いで消耗した所を、ピンポイントでサポートする。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 103601, 0, 3, "キョウカ", 103601, 0, 0, 810, 0, 2.07, 103601, 7, "きょうか", "2030/12/31 15:00:00", 0, 7, 450, 0, "2015/04/01 15:00:00", 103601, "【魔法】後衛から強力な魔法で攻撃するちびっこ優等生。\nスキルで魔法攻撃力を瞬間的に高めた後に放つ\nユニオンバーストは敵単体への威力抜群。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 103701, 0, 3, "トモ", 103701, 2, 0, 220, 0, 1.965, 103701, 4, "とも", "2030/12/31 15:00:00", 0, 4, 450, 0, "2015/04/01 15:00:00", 103701, "【物理】前衛で、素早い斬撃を仕掛け敵を屠る剣術少女。\nユニオンバーストで自分の攻撃力と行動速度を上昇させ、\nほか攻撃スキルの殲滅能力を極限まで高め敵を圧倒する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 103801, 0, 2, "シオリ", 103801, 5, 0, 710, 0, 1.97, 103801, 8, "しおり", "2030/12/31 15:00:00", 0, 8, 450, 0, "2015/04/01 15:00:00", 103801, "【物理】最後衛から高火力スキルを連発するスナイパー。\nダメージを与えつつ、ＴＰを回復するスキルを持ち、\n強力な一撃のユニオンバーストを、素早く発動する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 104001, 0, 1, "アオイ", 104001, 9, 0, 785, 0, 1.97, 104001, 8, "あおい", "2030/12/31 15:00:00", 0, 8, 450, 0, "2015/04/01 15:00:00", 104001, "【物理】最後衛から状態異常の矢を放つ、ぼっちの射手。\nダメージと共に付与する毒や麻痺の追加効果により、\n防御力の高い敵であっても、確実にＨＰを削りとる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 104201, 0, 2, "チカ", 104201, 10, 0, 790, 0, 2.27, 104201, 7, "ちか", "2030/12/31 15:00:00", 0, 7, 450, 0, "2015/04/01 15:00:00", 104201, "【魔法】後衛から、前衛の戦いをサポートする唱喚士。\nユニオンバーストで、味方の回復と敵への攻撃を行う\n精霊を最前線に唱喚する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 104301, 0, 3, "マコト", 104301, 4, 0, 165, 0, 2.125, 104301, 5, "まこと", "2030/12/31 15:00:00", 0, 5, 450, 0, "2015/04/01 15:00:00", 104301, "【物理】前衛で、敵の防御力を削り取る、正義の獣人。\n敵の盾役の防御力を下げ、着実にダメージを与えることで\n早期に敵の守りを突破する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 104401, 0, 3, "イリヤ", 104401, 12, 0, 425, 0, 1.425, 104401, 3, "いりや", "2030/12/31 15:00:00", 0, 3, 450, 0, "2015/04/01 15:00:00", 104401, "【魔法】中衛で命を削り攻撃する「夜を統べる者」。\n自身のＨＰと引き換えに放つスキルは高い殲滅力を誇り\n範囲攻撃における威力では他の追随を許さない。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 104501, 0, 2, "クウカ", 104501, 12, 0, 130, 0, 2.375, 104501, 2, "くうか", "2030/12/31 15:00:00", 0, 2, 450, 0, "2015/04/01 15:00:00", 104501, "【物理】前衛で囮となり、攻撃を引き付ける暴走ドＭ娘。\nユニオンバーストにより、自身に魔法バリアを張り、\n敵の魔法攻撃を吸収してＨＰを回復する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 104601, 0, 2, "タマキ", 104601, 8, 0, 215, 0, 2.25, 104601, 2, "たまき", "2030/12/31 15:00:00", 0, 2, 450, 0, "2015/04/01 15:00:00", 104601, "【物理】前衛の、対魔法パーティが得意な気まぐれ猫娘。\n攻撃スキルは、「魔法攻撃力が一番高い敵」を狙い撃ち、\nダメージ、魔法攻撃力ダウン、ＴＰ吸収と畳み掛ける。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 104701, 0, 3, "ジュン", 104701, 2, 0, 135, 0, 2.125, 104701, 5, "じゅん", "2030/12/31 15:00:00", 0, 5, 450, 0, "2015/04/01 15:00:00", 104701, "【物理】最前衛で、完全防御スキルを操る騎士団長。\nユニオンバーストであらゆるダメージを吸収するバリアを\n展開できる。特に長期戦で圧倒的な防御性能を誇る。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 104801, 0, 2, "ミフユ", 104801, 8, 0, 420, 0, 2.19, 104801, 6, "みふゆ", "2030/12/31 15:00:00", 0, 6, 450, 0, "2015/04/01 15:00:00", 104801, "【物理】中衛の、スタンと回復のスキルを持つ傭兵戦士。\n高い防御力と自己回復能力を併せ持つ事で、\n中衛の守りを堅固にし、パーティを底支えする。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 104901, 0, 3, "シズル", 104901, 6, 0, 285, 0, 2.375, 104901, 5, "しずる", "2030/12/31 15:00:00", 0, 5, 450, 0, "2015/04/01 15:00:00", 104901, "【物理】前衛で、物理攻撃から味方を守る、お姉ちゃん。\nスキルで物理無効バリアを展開し、味方全員を守るほか、\n自身はさらに物理吸収バリアを纏い、敵前衛を討つ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 105001, 0, 1, "ミサキ", 105001, 15, 0, 760, 0, 2.07, 105001, 7, "みさき", "2030/12/31 15:00:00", 0, 7, 450, 0, "2015/04/01 15:00:00", 105001, "【魔法】後衛から、範囲攻撃を行う、レディ・ウィッチ。\n複数回の範囲攻撃を放つスキルや、目の前の敵全てを\n攻撃するユニオンバーストを持ち、範囲殲滅に特化する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 105101, 0, 2, "ミツキ", 105101, 11, 0, 565, 0, 2.25, 105101, 5, "みつき", "2030/12/31 15:00:00", 0, 5, 450, 0, "2015/04/01 15:00:00", 105101, "【物理】中衛で、敵弱体化フィールドを操る隻眼の悪魔。\nフィールドの持続時間は短いが、範囲内の敵の\n物理防御力を大幅に減らす効果を持つ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 105201, 0, 1, "リマ", 105201, 5, 0, 105, 0, 2.215, 105201, 4, "りま", "2030/12/31 15:00:00", 0, 4, 450, 0, "2015/04/01 15:00:00", 105201, "【物理】最前衛で味方を守る、恋する乙女。\nバトル開始後、しばらくしてから最前線まで\n突進してきて、敵の目の前に立ちはだかる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 105301, 0, 3, "モニカ", 105301, 12, 0, 410, 0, 2.24, 105301, 4, "もにか", "2030/12/31 15:00:00", 0, 4, 450, 0, "2015/04/01 15:00:00", 105301, "【物理】中衛で、味方の攻撃を鼓舞する、軍人娘。\n味方全体の物理、魔法攻撃力の大幅アップに加えて、\n攻撃速度もあげることで、戦闘の早期終結を実現する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 105401, 0, 2, "ツムギ", 105401, 10, 0, 195, 0, 2.42, 105401, 1, "つむぎ", "2030/12/31 15:00:00", 0, 1, 450, 0, "2015/04/01 15:00:00", 105401, "【物理】前衛で、敵の妨害に特化したテーラーガール。\n敵を強制的に移動させる事で陣形を崩し、さらに\n移動速度・行動速度を低下させ相手の反撃を遅らせる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 105501, 0, 1, "アユミ", 105501, 12, 0, 510, 0, 2.34, 105501, 48, "あゆみ", "2030/12/31 15:00:00", 0, 48, 450, 0, "2019/03/19 15:00:00", 105501, "【物理】中衛で、どたばたと敵をかく乱する、純情少女。\n敵をスタンさせるスキルのほか、ユニオンバーストでは\n暗闇と混乱を付与することで敵を邪魔することができる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 105601, 0, 3, "ルカ", 105601, 2, 0, 158, 0, 1.965, 105601, 4, "るか", "2030/12/31 15:00:00", 0, 4, 450, 0, "2018/11/03 19:00:00", 105601, "【物理】前衛で味方のため剣を振るう、いなせな姉御。\n相手へのカウンターも行う挑発や、敵の防御力を下げる\nユニオンバーストを持ち、攻防両面で実力を発揮する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 105701, 0, 3, "ジータ", 105701, 4, 0, 245, 0, 1.965, 105701, 4, "じーた", "2030/12/31 15:00:00", 0, 4, 450, 0, "2015/04/01 15:00:00", 170101, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 105801, 0, 1, "ペコリーヌ", 105801, 1, 0, 155, 0, 2.25, 105801, 5, "ぺこりーぬ", "2030/12/31 15:00:00", 0, 5, 450, 0, "2015/04/01 15:00:00", 105801, "【物理】前衛にて、全力で仲間を護る、腹ペコ剣士。\n高いＨＰに加えて、自分自身でもＨＰ回復できるため\nギリギリまで味方の壁役を引き受ける。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 105901, 0, 1, "コッコロ", 105901, 1, 0, 500, 0, 2.34, 105901, 6, "こっころ", "2030/12/31 15:00:00", 0, 6, 450, 0, "2015/04/01 15:00:00", 105901, "【物理】中衛で、補助と攻撃で皆を支える、導きの巫女。\nユニオンバーストは、味方全体の攻撃力アップに加えて\n自らも回復するため、継続的なサポートが可能となる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 106001, 0, 1, "キャル", 106001, 1, 0, 750, 0, 2.07, 106001, 7, "きゃる", "2030/12/31 15:00:00", 0, 7, 450, 0, "2015/04/01 15:00:00", 106001, "【魔法】後衛から、強力な全体攻撃を放つ、強気な猫娘。\nスキルで敵の物理、魔法両方の防御力を下げるため\n編成を選ばずにバトルを有利に進められる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 106101, 0, 3, "ムイミ", 106101, 7, 1, 162, 0, 1.8, 106101, 2, "むいみ", "2025/05/03 18:59:59", 0, 2, 450, 0, "2025/04/30 12:00:00", 106101, "【物理】前衛で、伝説の剣「天楼覇断剣」を振るう少女。\n小技を駆使する通常の戦闘スタイルから一転、ユニオン\nバースト後は「天楼覇断剣」を携え、敵を薙ぎ払う。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 106301, 0, 3, "アリサ", 106301, 1, 0, 625, 0, 1.97, 106301, 8, "ありさ", "2030/12/31 15:00:00", 0, 8, 450, 0, "2015/04/01 15:00:00", 106301, "【物理】後衛の、長期戦に優れた、森の守護者見習い。\nＴＰ回復によるユニオンバーストの速攻が可能。さらに\n使用後はスキル効果が上昇するため高い殲滅力を誇る。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 106401, 0, 3, "シェフィ", 106401, 1, 0, 368, 0, 1.84, 106401, 4, "しぇふぃ", "2030/12/31 15:00:00", 0, 4, 450, 0, "2021/02/15 23:00:00", 106401, "【物理】中衛で氷雪を操り敵を凍滅する、氷竜の少女。\nユニオンバーストで獲得する【氷竜の印】を消費して、\nスキルの効果を増幅し、清廉な剣技で敵を切り伏せる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 106501, 0, 3, "カヤ", 106501, 17, 0, 168, 0, 2.17, 106501, 1, "かや", "2030/12/31 15:00:00", 0, 1, 450, 0, "2019/11/15 15:00:00", 106501, "【物理】前衛で、敵を殴り倒す喧嘩屋ドラゴン族。\nスキルで自身の物理攻撃力を高め、全身全霊を懸け放つ\n初弾のユニオンバーストは、超大な破壊力を誇る。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 106601, 0, 3, "イノリ", 106601, 17, 0, 197, 0, 1.55, 106601, 3, "いのり", "2030/12/31 15:00:00", 0, 3, 450, 0, "2020/06/17 15:00:00", 106601, "【物理】前衛で範囲攻撃が得意な口達者のドラゴン娘。\nユニオンバーストで範囲内の敵をまとめて吹き飛ばし、\n陣形を乱したところで、敵を一気に焼き尽くす。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 106701, 0, 3, "ホマレ", 106701, 17, 1, 727, 0, 2.27, 106701, 21, "ほまれ", "2025/05/03 18:59:59", 0, 7, 450, 0, "2025/04/30 12:00:00", 106701, "【魔法】後衛から無窮の魔力で全てを支配する龍の首領。\n障壁となる敵を龍眼で捉え、多彩な補助系スキルで敵の\n魔法攻撃からの耐性を弱め、雷霆の一撃で灰燼に帰す。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 106801, 0, 3, "ラビリスタ", 106801, 6, 1, 560, 0, 1.55, 106801, 4, "らびりすた", "2025/05/03 18:59:59", 0, 4, 450, 0, "2025/04/30 12:00:00", 106801, "【物理】中衛で、万有を自在に創造する『迷宮女王』。\n七冠としての権能を解放するユニオンバーストで自身を\n極大に強化し比類ない攻撃能力で仇なす者を剿滅する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 106901, 0, 3, "カイザーインサイト", 106901, 1, 1, 660, 0, 2.0, 106901, 0, "かいざーいんさいと", "2030/12/31 15:00:00", 0, 45, 450, 0, "2022/11/15 15:00:00", 106901, "【物理】後衛で、天の星を瞳に宿し、覇道を進む皇。\n権能を解放し敵全体のバリアと全ステータスアップ効果を\n解除し、耐久力ダウンと複数の広範囲攻撃で敵を滅する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 107001, 0, 3, "ネネカ", 107001, 1, 1, 660, 0, 2.0, 107001, 0, "ねねか", "2025/05/03 18:59:59", 0, 0, 450, 0, "2025/04/30 12:00:00", 107001, "【魔法】後衛で、分身生成し敵を圧倒する『変貌大妃』。\n分身はネネカ自身と同じスキルをくり出し敵を攻撃する。\nその攻撃密度と制圧力の高さは他の追随を許さない。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 107101, 0, 3, "クリスティーナ", 107101, 2, 1, 290, 0, 2.0, 107101, 10, "くりすてぃーな", "2025/05/03 18:59:59", 0, 4, 450, 0, "2025/04/30 12:00:00", 107101, "【物理】前衛で、絶対的な制圧力を誇る『誓約女君』。\n攻防一体かつ超大な破壊力を誇るユニオンバーストと、\nその発動を加速するＴＰ上昇アップスキルを併せ持つ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 107501, 0, 3, "ペコリーヌ（サマー）", 107501, 1, 1, 235, 0, 2.125, 107501, 5, "ぺこりーぬ", "2024/06/26 11:59:59", 0, 5, 450, 0, "2024/06/21 12:00:00", 107501, "【物理】前衛から強烈な範囲攻撃を放つ、渚のお姫様。\nかき氷を食べて物理攻撃力を一気に上昇させ、\nユニオンバーストを放つことで前方の敵を殲滅する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 107601, 0, 1, "コッコロ（サマー）", 107601, 1, 1, 535, 0, 2.34, 107601, 6, "こっころ", "2030/12/31 15:00:00", 0, 6, 450, 0, "2020/06/19 15:00:00", 107601, "【物理】中衛で、物理キャラの補助を行う癒しの巫女。\nＨＰが一番少ない味方単体への特大回復スキルを持ち、\n瀕死の味方ですら瞬時に治癒する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 107701, 0, 3, "スズメ（サマー）", 107701, 3, 1, 775, 0, 2.07, 107701, 7, "すずめ", "2024/06/26 11:59:59", 0, 7, 450, 0, "2024/06/21 12:00:00", 107701, "【魔法】後衛の防衛能力に秀でた、夏のドジっ娘メイド。\n味方全体に防御力アップと継続ＨＰ回復をかけ、\nさらに壁になるゴーレムを呼んで、戦線を支える。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 107801, 0, 3, "キャル（サマー）", 107801, 1, 1, 780, 0, 1.92, 107801, 7, "きゃる", "2024/06/26 11:59:59", 0, 7, 450, 0, "2024/06/21 12:00:00", 107801, "【魔法】後衛から強力な単体攻撃を放つ真夏の猫娘。\nスキルで敵の魔法防御力を下げた上で、\n敵単体への魔法攻撃を繰り出し、大ダメージを与える。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 107901, 0, 3, "タマキ（サマー）", 107901, 8, 1, 225, 0, 2.0, 107901, 2, "たまき", "2024/06/26 11:59:59", 0, 2, 450, 0, "2024/06/21 12:00:00", 107901, "【物理】前衛で連続攻撃を放つ、海辺の気まぐれ猫娘。\nランダムな相手への単体攻撃を計４度行う\nユニオンバーストは、対象がランダムだが威力は抜群。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 108001, 0, 1, "ミフユ（サマー）", 108001, 8, 1, 495, 0, 2.19, 108001, 6, "みふゆ", "2030/12/31 15:00:00", 0, 6, 450, 0, "2020/07/20 15:00:00", 108001, "【物理】中衛で、攻撃と補助の両方をこなす海の傭兵。\nユニオンバーストの効果で味方全体の物理攻撃力を高め、\n物理攻撃パーティの能力アップに一役買う。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 108101, 0, 3, "シノブ（ハロウィン）", 108101, 0, 1, 440, 0, 1.55, 108101, 3, "しのぶ", "2024/10/28 11:59:59", 0, 3, 450, 0, "2024/10/24 12:00:00", 108101, "【物理】中衛で、弱った敵を刈り取る幻夜の霊能少女。\n弱った敵単体に大ダメージを与えるユニオンバーストは\n対象を撃破時さらに敵全体に追加ダメージを与える。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 108201, 0, 1, "ミヤコ（ハロウィン）", 108201, 0, 1, 590, 0, 2.42, 108201, 1, "みやこ", "2030/12/31 15:00:00", 0, 1, 450, 0, "2020/09/23 15:00:00", 108201, "【物理】中衛から、敵陣の後方を狙い撃つ幽霊狼少女。\n前方の相手を無視して妨害スキルやユニオンバーストを\n敵後方に放ち、特に防御力が低いキャラの脅威になる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 108301, 0, 3, "ミサキ（ハロウィン）", 108301, 15, 1, 815, 0, 2.07, 108301, 7, "みさき", "2024/10/28 11:59:59", 0, 7, 450, 0, "2024/10/24 12:00:00", 108301, "【魔法】後衛で、妨害スキルを操るオシャレ魔法少女。\n相手を誘惑状態にするスキルや、複数の状態異常を\n同時に付与するユニオンバーストで相手をかく乱する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 108401, 0, 3, "チカ（クリスマス）", 108401, 10, 1, 770, 0, 2.27, 108401, 7, "ちか", "2024/12/31 11:59:59", 0, 7, 450, 0, "2024/12/22 12:00:00", 108401, "【魔法】後衛で、精霊を唱喚して戦う雪華の歌姫。\nユニオンバーストで呼び出す精霊たちはＨＰやＴＰを\n回復する能力を持ち、不利な戦況をも一変させる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 108501, 0, 1, "クルミ（クリスマス）", 108501, 15, 1, 295, 0, 1.55, 108501, 3, "くるみ", "2030/12/31 15:00:00", 0, 3, 450, 0, "2020/11/24 15:00:00", 108501, "【物理】前衛から、ベルの音色で味方を守る小さな女優。\n攻撃を受けるまで周囲にいる味方の防御力を大きく高める\nスキルを持つ。活用できれば無類の耐久力を誇る。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 108601, 0, 3, "アヤネ（クリスマス）", 108601, 10, 1, 190, 0, 1.425, 108601, 3, "あやね", "2024/12/31 11:59:59", 0, 3, 450, 0, "2024/12/22 12:00:00", 108601, "【物理】前衛で、敵をなぎ倒していく聖夜のくまっ子。\nユニオンバーストはＨＰを消費するが威力は絶大。\nスキルで物理攻撃力を上げ、さらにダメージアップ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 108701, 0, 3, "ヒヨリ（ニューイヤー）", 108701, 7, 1, 170, 0, 2.17, 108701, 1, "ひより", "2025/01/20 11:59:59", 0, 1, 450, 0, "2025/01/15 15:00:00", 108701, "【物理】前衛で、物理火力を担う、振り袖姿の元気娘。\n物理攻撃キャラの攻撃力を上昇させるスキルを使う。\nさらに高い威力の単体ユニオンバーストの攻撃力は随一。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 108801, 0, 3, "ユイ（ニューイヤー）", 108801, 7, 1, 745, 0, 2.27, 108801, 21, "ゆい", "2025/01/20 11:59:59", 0, 7, 450, 0, "2025/01/15 15:00:00", 108801, "【魔法】後衛の、補助魔法に特化した、晴れ姿の癒し手。\n自身の攻撃力と引き換えに強力なバリアと継続回復状態を\n味方全体に付与する。絶大な防御能力は他を圧倒する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 108901, 0, 1, "レイ（ニューイヤー）", 108901, 7, 1, 153, 0, 2.215, 108901, 22, "れい", "2030/12/31 15:00:00", 0, 4, 450, 0, "2020/12/22 15:00:00", 108901, "【物理】前衛で、魔法攻撃から味方を守る、華麗な剣士。\nスキルで範囲内の味方に魔法無効バリアを展開し、\nさらにユニオンバーストで敵をスタンさせ攻撃を断つ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 109001, 0, 1, "エリコ（バレンタイン）", 109001, 11, 1, 187, 0, 1.9, 109001, 3, "えりこ", "2030/12/31 15:00:00", 0, 3, 450, 0, "2021/01/25 15:00:00", 109001, "【物理】前衛で、ピンチをチャンスに変える愛の壊し屋。\nスキルはＨＰを消費し、自身の攻撃力を高める。また、\nユニオンバーストはＨＰが低いほど超絶威力を発揮する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 109101, 0, 3, "シズル（バレンタイン）", 109101, 7, 1, 385, 0, 2.125, 109101, 5, "しずる", "2025/02/24 11:59:59", 0, 5, 450, 0, "2025/02/20 12:00:00", 109101, "【物理】中衛で皆を助けるパティシエールのお姉ちゃん。\n複数のパラメータが同時に上昇するフィールドを展開し、\nさらに効果時間中はスキル効果が大幅に強化される。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 109201, 0, 3, "アン", 109201, 6, 0, 630, 0, 2.27, 109201, 23, "あん", "2030/12/31 15:00:00", 0, 7, 450, 0, "2019/03/31 12:00:00", 109201, "【魔法】後衛で、英霊の召喚術を武器に戦うお姫様。\n味方に英霊の加護を付与するスキルによるサポーターと、\n高威力の魔法によるアタッカーの二つの役割を併せ持つ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 109301, 0, 1, "ルゥ", 109301, 9, 1, 640, 0, 2.27, 109301, 23, "るぅ", "2030/12/31 15:00:00", 0, 7, 450, 0, "2021/03/23 15:00:00", 109301, "【魔法】後衛で、オメメちゃんと戦う、ノーテンキ少女。\nスキルで呼び出すオメメちゃんは敵の攻撃を防ぐほか、\nその数が多いほどユニオンバーストの威力を増加させる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 109401, 0, 3, "グレア", 109401, 9, 0, 525, 0, 2.27, 109401, 1, "ぐれあ", "2030/12/31 15:00:00", 0, 1, 450, 0, "2019/04/19 15:00:00", 109401, "【魔法】中衛で、炎を操り敵を薙ぎ払う、竜人の少女。\n高い魔法攻撃力を生かした範囲攻撃を得意とする。\nまた、飛行能力を駆使して放つ突進攻撃も強力。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 109501, 0, 3, "クウカ（オーエド）", 109501, 12, 0, 140, 0, 2.066, 109501, 2, "くうか", "2030/12/31 15:00:00", 0, 7, 450, 0, "2019/04/30 12:00:00", 109501, "【魔法】最前衛で、味方を鼓舞する着物姿のドＭ娘。\n味方の魔法攻撃力を高め、敵の魔法防御力を下げる事で、\n魔法パーティのサポート兼防御役として活躍する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 109601, 0, 3, "ニノン（オーエド）", 109601, 12, 0, 175, 0, 2.0, 109601, 2, "にのん", "2030/12/31 15:00:00", 0, 2, 450, 0, "2019/05/17 15:00:00", 109601, "【物理】最前衛で、忍法を駆使して敵と戦うクノイチ。\nユニオンバーストはクリティカル時のダメージを１．５倍\nにする特性を持ち、うまくかみ合った時の威力は抜群。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 109701, 0, 3, "レム", 109701, 9, 1, 540, 0, 2.25, 109701, 24, "れむ", "2024/09/25 11:59:59", 0, 13, 450, 0, "2024/09/15 15:00:00", 109701, "【物理】中衛で、鬼の力で敵を粉砕する、双子の妹。\n回復スキルの他にも、温度を操るスキルを得意とし、\n敵を凍結させた上でユニオンバーストで薙ぎ払う。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (1, 2, 0, 109801, 0, 1, "ラム", 109801, 9, 1, 545, 0, 2.5, 109801, 24, "らむ", "2030/12/31 15:00:00", 0, 7, 450, 0, "2015/04/01 15:00:00", 109801, "【魔法】中衛で、特殊能力で味方を補助する、双子の姉。\n相手の物理攻撃を見切って回避させる「千里眼」や、\n敵全体を束縛するユニオンバーストの補助は効果絶大。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 109901, 0, 3, "エミリア", 109901, 9, 1, 725, 0, 2.27, 109901, 23, "えみりあ", "2024/09/25 11:59:59", 0, 7, 450, 0, "2024/09/15 15:00:00", 109901, "【魔法】後衛で、攻撃と回復をこなす、ハーフエルフ。\n高い魔力で攻撃魔法を繰り出して敵を蹴散らしつつ、\nユニオンバーストは瀕死の味方すらも瞬時に癒す。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 110001, 0, 3, "スズナ（サマー）", 110001, 15, 1, 705, 0, 1.82, 110001, 8, "すずな", "2024/06/26 11:59:59", 0, 8, 450, 0, "2024/06/21 12:00:00", 110001, "【物理】後衛で高威力の弓技を放つ夏のカリスマモデル。\nバトル中に放つ「サマーランウェイ♪」でＴＰを全回復\nして、発動後のユニオンバーストがクリティカルになる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 110101, 0, 1, "イオ（サマー）", 110101, 15, 1, 715, 0, 2.4, 110101, 5, "いお", "2030/12/31 15:00:00", 0, 5, 450, 0, "2021/05/18 15:00:00", 110101, "【魔法】後衛で、敵の体力を奪い取る、夏の夜の先生。\nダメージを与えつつ味方を回復するスキルを複数持ち、\n攻守どちらの側でも高い能力を発揮する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 0, 0, 110201, 0, 1, "ミサキ（サマー）", 110201, 15, 0, 0, 0, 0.0, 0, 7, "みさき", "2030/12/31 15:00:00", 0, 7, 0, 0, "2015/04/01 15:00:00", 0, "");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 110301, 0, 3, "サレン（サマー）", 110301, 3, 1, 585, 0, 2.24, 110301, 4, "されん", "2024/06/26 11:59:59", 0, 4, 450, 0, "2024/06/21 12:00:00", 110301, "【物理】中衛で、味方の速攻を支える海辺のサレンママ。\nバトル開始時に味方全体のＴＰを一気に溜めることで、\n迅速にユニオンバーストを発動させることを可能にする。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 110401, 0, 3, "マコト（サマー）", 110401, 4, 1, 180, 0, 2.125, 110401, 5, "まこと", "2024/07/31 11:59:59", 0, 5, 450, 0, "2024/07/23 12:00:00", 110401, "【物理】前衛で攻撃対象が１つの敵に特化した海の狼娘。\n攻撃対象が１つの場合、スキルとユニオンバーストともに\n真価を発揮し他を圧倒する絶大な破壊力で敵をなぎ払う。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 110501, 0, 1, "カオリ（サマー）", 110501, 4, 1, 425, 0, 2.42, 110501, 1, "かおり", "2030/12/31 15:00:00", 0, 1, 450, 0, "2021/06/18 15:00:00", 110501, "【物理】中衛で、敵をまとめてなぎ倒す、真夏の南国娘。\n吹き飛ばし効果を持つスキルで敵をまとめ、攻撃対象が\n多い程、威力が増すユニオンバーストで敵をなぎ倒す。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 110601, 0, 3, "マホ（サマー）", 110601, 4, 1, 792, 0, 2.27, 110601, 7, "まほ", "2024/07/31 11:59:59", 0, 7, 450, 0, "2024/07/23 12:00:00", 110601, "【魔法】後衛で、膨大な魔力を振るう、真夏のおとぎ姫。\n高火力で対象がランダムなスキルやユニオンバーストは、\n攻撃対象が１つの敵に対して絶大なダメージを叩き出す。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 110701, 0, 3, "アオイ（編入生）", 110701, 4, 0, 680, 0, 1.82, 110701, 8, "あおい", "2030/12/31 15:00:00", 0, 8, 450, 0, "2019/09/03 21:00:00", 110701, "【物理】後衛で毒を操る、ぼっちエルフの編入生。\n敵が毒や猛毒になっていると強化される攻撃スキルと、\n敵の物理防御力を下げるスキルで味方をサポートする。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 110801, 0, 3, "クロエ", 110801, 2, 0, 185, 0, 2.125, 110801, 2, "くろえ", "2030/12/31 15:00:00", 0, 2, 450, 0, "2019/09/16 15:00:00", 110801, "【物理】前衛で、手数で圧倒する、ダウナー系エルフ。\n攻撃するたびに相手に【畏縮】ステータスを追加し、\nスキルのダメージと物理防御力ダウンに磨きをかける。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 110901, 0, 3, "チエル", 110901, 2, 0, 222, 0, 2.295, 110901, 1, "ちえる", "2030/12/31 15:00:00", 0, 1, 450, 0, "2020/04/15 15:00:00", 110901, "【物理】前衛でパンチを放つちぇる盛りＭＡＸな女の子。\nクリティカルを出すたびに【ちぇる】を溜め、自己を強化\nし続け、後半になるほど敵をちぇるっとじぇのさいする。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 111001, 0, 3, "ユニ", 111001, 2, 0, 807, 0, 2.27, 111001, 26, "ゆに", "2030/12/31 15:00:00", 0, 7, 450, 0, "2020/03/31 12:00:00", 111001, "【魔法】後衛で、味方の支援に特化した象牙の塔の才媛。\n自身の攻撃力は低いが、物理攻撃力の高い味方を強化し\n更に味方全体を魔法無効バリアで護りつつ勝利へ導く。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 111101, 0, 3, "キョウカ（ハロウィン）", 111101, 13, 1, 820, 0, 2.07, 111101, 7, "きょうか", "2024/10/28 11:59:59", 0, 7, 450, 0, "2024/10/24 12:00:00", 111101, "【魔法】後衛で味方の火力を高める、黒猫仮装の優等生。\n自分の魔法攻撃力に応じて効果が強化されるものと、\n効果が累積するもの等、多彩なスキルで攻撃力を高める。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 111201, 0, 1, "ミソギ（ハロウィン）", 111201, 13, 1, 212, 0, 2.17, 111201, 1, "みそぎ", "2030/12/31 15:00:00", 0, 1, 450, 0, "2021/08/16 15:00:00", 111201, "【物理】前衛で範囲攻撃を放つ、カボチャ衣装の悪戯娘。敵に５カウントで爆発する爆弾を仕掛けたり、カボチャの手榴弾を投げつけたりと、様々な範囲攻撃で敵を弄ぶ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 111301, 0, 3, "ミミ（ハロウィン）", 111301, 13, 0, 365, 0, 2.0, 111301, 5, "みみ", "2030/12/31 15:00:00", 0, 5, 450, 0, "2019/10/16 15:00:00", 111301, "【物理】中衛の、攻撃に特化した、ぐるぐるうさぎっこ。\n行動頻度は少ないが、高威力の範囲攻撃を放ち、\n味方全体の物理攻撃力を大きく高めるスキルも効果抜群。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 111401, 0, 3, "ルナ", 111401, 0, 0, 765, 0, 1.87, 111401, 25, "るな", "2030/12/31 15:00:00", 0, 7, 450, 0, "2019/10/31 12:00:00", 111401, "【魔法】後衛で、死霊術でおともだちを作る可憐な少女。\nルナがダメージを与える度に集まってくるおともだちを、\n各スキルで消費する。消費数に応じ強大な力を発揮する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 111501, 0, 3, "クリスティーナ（クリスマス）", 111501, 13, 1, 265, 0, 2.0, 111501, 10, "くりすてぃーな", "2024/12/31 11:59:59", 0, 4, 450, 0, "2024/12/22 12:00:00", 111501, "【物理】前衛で戦いを愉しむ、聖夜の『誓約女君』。\nユニオンバーストを使用すると得られるコインの有無で、\n補助と攻撃の二役を切り替え、華麗に敵を斬り倒す。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 111601, 0, 1, "ノゾミ（クリスマス）", 111601, 13, 1, 418, 0, 2.24, 111601, 4, "のぞみ", "2030/12/31 15:00:00", 0, 4, 450, 0, "2021/10/19 15:00:00", 111601, "【物理】中衛でパーティの守りを支えるサンタアイドル。\nスキルで物理攻撃を無効化し、後方の味方が多いほど\n物理防御力を高めるユニオンバーストで生存力を高める。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 111701, 0, 3, "イリヤ（クリスマス）", 111701, 13, 0, 255, 0, 1.3, 111701, 3, "いりや", "2030/12/31 15:00:00", 0, 3, 450, 0, "2019/12/20 15:00:00", 111701, "【魔法】前衛で、血を対価に敵を攻撃する聖夜の吸血鬼。\n残りＨＰが低い程ダメージが上昇するスキルと、ＨＰを\n消費するスキルを組み合わせ、絶大な破壊力を発揮する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 111801, 0, 3, "ペコリーヌ（ニューイヤー）", 111801, 13, 1, 248, 0, 1.965, 111801, 22, "ぺこりーぬ", "2025/01/20 11:59:59", 0, 4, 450, 0, "2025/01/15 15:00:00", 111801, "【物理】前衛で元気いっぱいに新年を祝う腹ペコお姫様。\n物理攻撃力を高めるスキルで味方を強化し、ＨＰが多い\nほどダメージが上昇するユニオンバーストで敵を討つ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 111901, 0, 3, "コッコロ（ニューイヤー）", 111901, 1, 1, 159, 0, 1.87, 111901, 23, "こっころ", "2025/01/20 11:59:59", 0, 7, 450, 0, "2025/01/15 15:00:00", 111901, "【物理】前衛で、味方の補助に秀でた、新風の巫女。\n物理クリティカル時のダメージアップのスキルで味方の\n殲滅力を高めつつ、挑発や継続回復で耐久面を支える。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 112001, 0, 3, "キャル（ニューイヤー）", 112001, 3, 1, 690, 0, 2.07, 112001, 21, "きゃる", "2025/01/20 11:59:59", 0, 7, 450, 0, "2025/01/15 15:00:00", 112001, "【魔法】後衛で、攻防双方で活躍する晴れ着姿の猫娘。\n与ダメージに応じて魔法攻撃力がアップするユニオン\nバーストで、高いベースの攻撃力がさらに強大になる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 112101, 0, 1, "スズメ（ニューイヤー）", 112101, 1, 1, 722, 0, 2.27, 112101, 21, "すずめ", "2030/12/31 15:00:00", 0, 7, 450, 0, "2021/11/16 15:00:00", 112101, "【魔法】後衛で祈りによるサポートを行うドジっ娘巫女。\nスキルの魔法無効バリアで耐久力を高め、ユニオン\nバーストでＨＰ回復と行動速度アップで戦況を整える。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 112201, 0, 3, "カスミ（マジカル）", 112201, 9, 0, 730, 0, 2.27, 112201, 7, "かすみ", "2030/12/31 15:00:00", 0, 7, 450, 0, "2020/01/31 12:00:00", 112201, "【魔法】後衛の、妨害に特化した能力を持つ魔法探偵。\n相手のＴＰを大きく減少させるスキルや、遠くの敵を\n束縛するスキルを操り、相手の連携を大きく乱す。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 112301, 0, 1, "シオリ（マジカル）", 112301, 5, 1, 712, 0, 1.97, 112301, 8, "しおり", "2030/12/31 15:00:00", 0, 8, 450, 0, "2021/12/16 15:00:00", 112301, "【物理】後衛で味方の火力の底上げを担う魔法狩人。\nユニオンバーストで味方全体の物理攻撃力を大きく高め\nスキルは範囲内の物理攻撃力を高め、輝矢の一撃を放つ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 112401, 0, 3, "ウヅキ（デレマス）", 112401, 18, 1, 370, 0, 2.24, 112401, 4, "うづき", "2021/03/24 11:59:59", 0, 4, 450, 0, "2021/03/08 12:00:00", 112401, "【物理】中衛で、味方を鼓舞して戦う、キュートな少女。\n味方をＴＰや攻撃力をアップさせるスキルでサポートし、\n自身も強力な範囲攻撃で敵をなぎ払う。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 112501, 0, 3, "リン（デレマス）", 112501, 18, 1, 153, 0, 2.215, 112501, 4, "りんでれます", "2021/03/24 11:59:59", 0, 4, 450, 0, "2021/03/08 12:00:00", 112501, "【物理】前衛で、氷を創出し味方を護る、クールな少女。\n目の前の敵を束縛するスキルや挑発で行動を妨害し、\n自身にもバリアを展開し、鉄壁の防御能力を発揮する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (1, 2, 0, 112601, 0, 1, "ミオ（デレマス）", 112601, 18, 1, 695, 0, 2.27, 112601, 7, "みお", "2030/12/31 15:00:00", 0, 7, 450, 0, "2015/04/01 15:00:00", 112601, "【魔法】後衛で攻防共に活躍するパッション溢れる少女。\nダメージを受けた味方中心に回復魔法で補助をし、\nさらに魔法攻撃を仕掛けて、敵を一網打尽にする。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 112701, 0, 3, "リン（レンジャー）", 112701, 3, 0, 422, 0, 2.19, 112701, 6, "りん", "2030/12/31 15:00:00", 0, 6, 450, 0, "2020/04/30 12:00:00", 112701, "【物理】中衛から、敵の守りを貫くドングリレンジャー。\n戦闘開始と共に範囲内の敵の物理防御力を大幅に下げ、\n序盤から大ダメージを与えられる戦況を作り出す。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 112801, 0, 3, "マヒル（レンジャー）", 112801, 5, 0, 390, 0, 2.19, 112801, 6, "まひる", "2030/12/31 15:00:00", 0, 6, 450, 0, "2020/05/15 15:00:00", 112801, "【物理】中衛で、多勢相手が十八番のまきばの戦士。\n相手を吹き飛ばすスキルを多用し敵の陣形を押し込む。\n範囲攻撃と混乱付与スキルを駆使し一気に殲滅する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 112901, 0, 3, "リノ（ワンダー）", 112901, 6, 0, 730, 0, 1.97, 112901, 8, "りの", "2030/12/31 15:00:00", 0, 8, 450, 0, "2020/06/03 19:00:00", 112901, "【物理】後衛で、希望の力で戦う、不思議の国の救世主。\nクリティカルすると効果アップのスキルや味方の数が多い\n程、威力がアップするユニオンバーストで敵を殲滅する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 113001, 0, 1, "アユミ（ワンダー）", 113001, 12, 1, 508, 0, 2.34, 113001, 6, "あゆみ", "2030/12/31 15:00:00", 0, 6, 450, 0, "2020/05/31 12:00:00", 113001, "【物理】中衛で、戦場の動向を自在に操る白兎の乙女。\n敵の行動速度をダウンさせ、味方の速度をアップさせる\nスキルと敵の時を止めるスキルで、常に味方を支える。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 113101, 0, 3, "ルカ（サマー）", 113101, 6, 1, 192, 0, 1.3, 113101, 27, "るか", "2024/07/31 11:59:59", 0, 27, 450, 0, "2024/07/23 12:00:00", 113101, "【物理】前衛で、流麗な太刀捌きを魅せる若夏の姉御。\nダメージを与えた回数に応じて攻撃力が高まるスキルと、\n携えた二刀の幾刃もの斬撃で、眼前の敵を薙ぎ払う。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 113201, 0, 1, "アンナ（サマー）", 113201, 12, 1, 256, 0, 1.625, 113201, 28, "あんな", "2030/12/31 15:00:00", 0, 5, 450, 0, "2022/04/18 15:00:00", 113201, "【魔法】前衛で皆の力を借り受け力を振るう真夏の冥姫。\n味方全体の魔法攻撃力を代償に自身の魔法攻撃力を劇的に\n高め、熾烈な攻撃魔法を繰り出し大ダメージを与える。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 113301, 0, 3, "ナナカ（サマー）", 113301, 12, 0, 468, 0, 2.07, 113301, 7, "ななか", "2030/12/31 15:00:00", 0, 7, 450, 0, "2020/07/15 15:00:00", 113301, "【魔法】中衛の多勢相手の戦いが得意な真夏の魔法少女。\n敵の数に応じて効果が上昇する防御力ダウンのスキルや、\n多彩な範囲攻撃を操り、真夏の戦いをサイカワに制する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 113401, 0, 3, "ハツネ（サマー）", 113401, 12, 1, 567, 0, 1.92, 113401, 29, "はつね", "2024/07/31 11:59:59", 0, 7, 450, 0, "2024/07/23 12:00:00", 113401, "【魔法】中衛から全体魔法攻撃を放つ超能力チアガール。\nユニオンバーストで敵全体に絶大な一撃を放ち、\nその後、超能力発動の反動で枕を抱えて夢の中へ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 113501, 0, 1, "ミサト（サマー）", 113501, 12, 1, 697, 0, 2.07, 113501, 7, "みさと", "2030/12/31 15:00:00", 0, 7, 450, 0, "2022/05/18 15:00:00", 113501, "【魔法】後衛で、敵の脅威から生徒を守る夏女神な先生。\n味方の魔法防御力を高め、ＨＰを継続回復するスキルや、\nバリア展開のユニオンバーストで味方を堅固に守護する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 113601, 0, 3, "ジュン（サマー）", 113601, 12, 0, 182, 0, 2.0, 113601, 5, "じゅん", "2030/12/31 15:00:00", 0, 5, 450, 0, "2020/08/15 15:00:00", 113601, "【物理】前衛で、業火を従え悪を討つ真夏の騎士団長。\n敵単体にダメージを与えつつ、攻撃力を高めるユニオン\nバーストや、火傷を与えるスキルを操り敵を焼き尽くす。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 113701, 0, 3, "アカリ（エンジェル）", 113701, 12, 0, 530, 0, 1.92, 113701, 7, "あかり", "2030/12/31 15:00:00", 0, 7, 450, 0, "2020/09/03 19:00:00", 113701, "【魔法】中衛で、魔法攻撃をお見舞いする双子の妹天使。\n効果時間が短い分、絶大な効果の強化魔法で自身の攻撃力\nを大きく高め、威力抜群の単体魔法で敵を一掃する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 113801, 0, 3, "ヨリ（エンジェル）", 113801, 12, 0, 531, 0, 2.34, 113801, 6, "より", "2030/12/31 15:00:00", 0, 6, 450, 0, "2020/09/19 15:00:00", 113801, "【魔法】中衛で、補助魔法で味方を助ける双子の姉天使。\n防御力を大幅に高めつつ、対象の味方に敵の注意を引か\nせるなど、特殊で強力なスキルを駆使し敵を翻弄する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 113901, 0, 3, "ツムギ（ハロウィン）", 113901, 12, 1, 152, 0, 2.375, 113901, 2, "つむぎ", "2024/10/28 11:59:59", 0, 2, 450, 0, "2024/10/24 12:00:00", 113901, "【物理】前衛で敵の物理攻撃を妨害する吸血鬼テーラー。\n挑発と物理無効バリア、さらに最も物理攻撃力が高い敵を\n狙った妨害スキルによって、鉄壁の防御を織り上げる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 114001, 0, 3, "レイ（ハロウィン）", 114001, 12, 0, 375, 0, 1.965, 114001, 4, "れい", "2030/12/31 15:00:00", 0, 4, 450, 0, "2020/10/15 15:00:00", 114001, "【物理】中衛で、手負いの敵を死に誘う、幽雅の剣士。\nＨＰが50％未満の敵に対し放つと、威力が大アップする\n範囲攻撃を繰り出し負傷した敵の戦意を一気に叩き折る。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 114101, 0, 1, "マツリ（ハロウィン）", 114101, 12, 1, 186, 0, 2.295, 114101, 1, "まつり", "2030/12/31 15:00:00", 0, 1, 450, 0, "2022/07/19 8:00:00", 114101, "【物理】前衛で鋭爪を突き立てるハロウィン騎士見習い。\nユニオンバーストの使用回数に応じて強化されるスキルで\n与えるダメージと行動速度をアップさせ、敵を斬り裂く。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 114201, 0, 3, "モニカ（マジカル）", 114201, 12, 0, 528, 0, 2.24, 114201, 4, "もにか", "2030/12/31 15:00:00", 0, 4, 450, 0, "2020/10/31 12:00:00", 114201, "【物理】中衛で愛と希望の力を胸に指揮を執る魔法提督。\nユニオンバーストで敵単体の物理防御力を下げ、範囲内の\n味方の物理攻撃力アップスキルで、一気に戦況を決める。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 114301, 0, 3, "トモ（マジカル）", 114301, 2, 0, 402, 0, 2.0, 114301, 4, "とも", "2030/12/31 15:00:00", 0, 4, 450, 0, "2020/11/21 15:00:00", 114301, "【物理】中衛で正義の力を魔法にのせて戦う魔法剣士。\n自身の物理攻撃力を魔法攻撃力に加える魔法少女の力と、\nたゆまぬ努力で獲得した剣技で、華麗な魔法攻撃を放つ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 114401, 0, 3, "アキノ（クリスマス）", 114401, 2, 1, 189, 0, 2.0, 114401, 5, "あきの", "2024/12/31 11:59:59", 0, 5, 450, 0, "2024/12/22 12:00:00", 114401, "【物理】前衛で味方のサポートを力に戦う、聖夜の令嬢。\nステータスアップ効果を受けると増加する【聖夜の煌き】\nでスキルを大きく強化し、聖夜を彩る強烈な一撃を放つ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 114501, 0, 3, "サレン（クリスマス）", 114501, 3, 0, 150, 0, 2.09, 114501, 4, "されん", "2030/12/31 15:00:00", 0, 4, 450, 0, "2020/12/21 15:00:00", 114501, "【物理】前衛で、光を操り味方を守る聖夜のサレンママ。\n敵の攻撃を防ぎ、ダメージを与えるユニオンバーストや、\nダメージを与えつつ回復するスキルで、攻守双方を担う。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 114601, 0, 1, "ユカリ（クリスマス）", 114601, 2, 1, 408, 0, 2.09, 114601, 5, "ゆかり", "2030/12/31 15:00:00", 0, 5, 450, 0, "2022/09/17 15:00:00", 114601, "【物理】中衛で物理キャラを支援し戦う聖夜の元聖騎士。\n魔法攻撃力の高い敵単体のＴＰ減少や周囲の味方の魔法\n防御力アップスキルで、対魔法戦で無類の輝きを放つ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 114701, 0, 1, "ムイミ（ニューイヤー）", 114701, 2, 1, 138, 0, 2.0, 114701, 31, "むいみ", "2030/12/31 15:00:00", 0, 2, 450, 0, "2022/10/16 15:00:00", 114701, "【物理】前衛で、新風纏う「天楼覇断剣」を振るう少女。\n皆より一足遅れて突撃し、敵の前衛を吹き飛ばした後、\n強化した範囲物理攻撃で、ダンゴになった敵を斬り払う。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 115001, 0, 3, "ネネカ（ニューイヤー）", 115001, 2, 1, 562, 0, 2.07, 115001, 21, "ねねか", "2025/01/20 11:59:59", 0, 7, 450, 0, "2025/01/15 15:00:00", 115001, "【魔法】中衛で艶やかな晴れ着を身に纏う『変貌大妃』。\n味方の魔法攻撃力アップやＨＰ、ＴＰを回復させるスキル\nで攻守にわたってサポートし苛烈な戦況でも勝利に導く。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 115501, 0, 3, "コッコロ（儀装束）", 115501, 1, 1, 533, 0, 2.0, 115501, 2, "こっころ", "2025/02/24 11:59:59", 0, 2, 450, 0, "2025/02/20 12:00:00", 115501, "【物理】中衛で、尊き儀装束を纏うエルフの里の巫女。\n自分の攻撃力を強化し、さらにＴＰ回復で攻撃の手数を\n増やす。クリティカル時の猛攻で仲間を守る剣となる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 115601, 0, 1, "ユイ（儀装束）", 115601, 7, 1, 578, 0, 1.97, 115601, 7, "ゆい", "2030/12/31 15:00:00", 0, 7, 450, 0, "2022/11/17 15:00:00", 115601, "【魔法】中衛で精霊術を操り味方を支える儀装の魔法士。\n複数の物理攻撃力の強化スキルで味方を攻撃支援しつつ\n強力な回復スキルで、前線を整えバトルを掌握する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 115701, 0, 3, "カスミ（サマー）", 115701, 9, 0, 738, 0, 2.27, 115701, 7, "かすみ", "2030/12/31 15:00:00", 0, 7, 450, 0, "2021/02/23 15:00:00", 115701, "【魔法】後衛で、敵の防御力を削ぎ取る渚の名探偵。\n攻撃力が高い敵に目標を定めて防御力を下げつつ、\n味方を強化するスキルで、どんな難事件も解決へと導く。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 115801, 0, 1, "リマ（シンデレラ）", 115801, 5, 1, 173, 0, 2.27, 115801, 4, "りま", "2030/12/31 15:00:00", 116101, 4, 450, 0, "2022/12/19 15:00:00", 115801, "【物理】前衛の魔法の果実でお姫様姿になった恋乙女。\n獣の姿からユニオンバーストで一定時間、人の姿に変身し\n味方全体の攻撃力アップスキルで、火力の底上げをする。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 115901, 0, 3, "マコト（シンデレラ）", 115901, 4, 0, 166, 0, 2.27, 115901, 5, "まこと", "2030/12/31 15:00:00", 0, 5, 450, 0, "2021/03/03 19:00:00", 115901, "【物理】前衛で、華装に身を包み流麗な剣舞を舞う狼娘。\n周囲の味方の数に応じて、スキルの威力と物理攻撃力\nアップのスキル効果が上がり、鼓舞激励の一斬を振るう。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 116001, 0, 3, "マホ（シンデレラ）", 116001, 9, 0, 645, 0, 2.27, 116001, 7, "まほ", "2030/12/31 15:00:00", 0, 7, 450, 0, "2021/03/22 15:00:00", 116001, "【魔法】後衛から、優雅に味方を支援するマホ先生。\n物理攻撃をする味方の攻撃力アップや、最遠の味方のＴＰ\nを回復するスキルで、しゃなりしゃなりと戦況を変える。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 116201, 0, 3, "クロエ（聖学祭）", 116201, 2, 0, 184, 0, 2.125, 116201, 2, "くろえ", "2030/12/31 15:00:00", 0, 2, 450, 0, "2021/04/15 15:00:00", 116201, "【物理】前衛で疾風の如く駆け抜ける、ダウナー女子。\n特定回数ダメージを与えるたびＴＰを全回復するスキルと\n発動ごとに攻撃力アップのスキルで勝利のテープを掴む。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 116301, 0, 3, "チエル（聖学祭）", 116301, 2, 0, 223, 0, 2.295, 116301, 32, "ちえる", "2030/12/31 15:00:00", 0, 1, 450, 0, "2021/03/31 12:00:00", 116301, "【物理】前衛で聖学祭を盛りアゲる、はぴちぇる系女子。\n攻撃ヒットのたびに【ちぇる】を貯め、威力が増すスキル\nと味方全体の物理攻撃力アップ効果のＵＢで勝利に導く。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 116401, 0, 3, "ユニ（聖学祭）", 116401, 2, 0, 808, 0, 2.27, 116401, 39, "ゆに", "2030/12/31 15:00:00", 0, 7, 450, 0, "2022/02/08 12:00:00", 116401, "【魔法】後衛から、仲間を啓蒙するユニちゃんズの才媛。\n自分以外の味方全員の物理・魔法両方の攻撃力アップと\nクリティカル時のダメージアップで皆を勝利へと導く。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 116501, 0, 3, "イノリ（タイムトラベル）", 116501, 17, 0, 252, 0, 2.295, 116501, 3, "いのり", "2030/12/31 15:00:00", 0, 3, 450, 0, "2021/04/30 12:00:00", 116501, "【物理】前衛で威勢よく、まくしたてる口撃系ドラゴン。\n全体物理攻撃力アップのＵＢは、味方の防御力を下げる\n代わりにＨＰが多いほど効果を高め、味方を勝利に導く。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 116601, 0, 3, "カヤ（タイムトラベル）", 116601, 17, 0, 169, 0, 2.295, 116601, 1, "かや", "2030/12/31 15:00:00", 0, 1, 450, 0, "2021/05/21 15:00:00", 116601, "【物理】前衛で味方を勝利にナビする喧嘩屋ドラゴン族。\nユニオンバーストで自身の攻撃速度を極大アップさせ、\n物理攻撃力アップスキルのシナジーで拳の雨を降らせる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 116701, 0, 3, "アオイ（作業服）", 116701, 9, 0, 527, 0, 1.82, 116701, 33, "あおい", "2030/12/31 15:00:00", 0, 33, 450, 0, "2021/05/31 12:00:00", 116701, "【物理】中衛で敵を妨害する、作業服姿のぼっちエルフ。\n友情の絆で結ばれた『マイフレンドくん』と放つＵＢは、\n敵の動きを阻み、物理防御力を劇的に下げる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 116801, 0, 1, "タマキ（作業服）", 116801, 8, 1, 216, 0, 2.295, 116801, 2, "たまき", "2030/12/31 15:00:00", 0, 2, 450, 0, "2023/03/16 15:00:00", 116801, "【物理】前衛でたい焼き器片手に悪を討つ売り子の猫娘。\n味方全体を物理攻撃力アップとＴＰ回復させ、ＵＢでさら\nに自分の攻撃力を特大強化し、驚異の威力を発揮する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 116901, 0, 3, "ミフユ（作業服）", 116901, 8, 0, 275, 0, 2.065, 116901, 6, "みふゆ", "2030/12/31 15:00:00", 0, 6, 450, 0, "2021/06/16 15:00:00", 116901, "【物理】前衛で、皆の盾となり進攻するバイトリーダー。\nバトル序盤は物理の攻防両方をスキルで強化。ＵＢ発動毎\nに自分のクリティカルをアップし猛烈な攻撃を繰り出す。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 117001, 0, 3, "エリコ（サマー）", 117001, 11, 1, 407, 0, 1.55, 117001, 3, "えりこ", "2024/08/31 11:59:59", 0, 3, 450, 0, "2024/08/26 19:00:00", 117001, "【物理】中衛で、火花を纏い夕闇を彩る真夏の壊し屋。\n二つのスキルで物理防御力を下げ、ダメージ量に応じて\nクリティカル上昇が延長するＵＢで眼前の敵を粉砕する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 117101, 0, 3, "シズル（サマー）", 117101, 6, 0, 163, 0, 2.0, 117101, 5, "しずる", "2030/12/31 15:00:00", 0, 5, 450, 0, "2021/07/15 12:00:00", 117101, "【物理】前衛で、堅牢に仲間を守る海辺のお姉ちゃん。\n物理防御力が高い程、効果が高まる複数のスキルを巧みに\n操り防御と補助役をしつつ範囲攻撃で攻撃役をもこなす。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 117201, 0, 3, "ノゾミ（サマー）", 117201, 10, 1, 417, 0, 2.09, 117201, 4, "のぞみ", "2024/08/31 11:59:59", 0, 4, 450, 0, "2024/08/26 19:00:00", 117201, "【物理】中衛でみんなを応援する真夏のトップアイドル。\nすべてのスキルで味方全体の物理攻撃をサポートし、\nバトル中盤から味方全体のＴＰ回復で、皆を勝利に導く。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 117301, 0, 3, "チカ（サマー）", 117301, 10, 0, 520, 0, 2.07, 117301, 7, "ちか", "2030/12/31 15:00:00", 0, 7, 450, 0, "2021/08/15 15:00:00", 117301, "【魔法】中衛で、守護の賛歌を捧げる夏海の歌姫。\n最序盤に味方の魔法防御を大幅に強化し、吸収バリアや\nＨＰ回復スキルで、如何なる猛攻からも味方を守る。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 117401, 0, 1, "ツムギ（サマー）", 117401, 10, 1, 355, 0, 2.42, 117401, 1, "つむぎ", "2030/12/31 15:00:00", 0, 1, 450, 0, "2023/05/16 15:00:00", 117401, "【物理】中衛で敵を引き寄せ陣形を崩す夕凪のテーラー。\n最も攻撃力の高い敵を、敵陣から自陣に引き寄せつつ\n束縛や行動速度ダウンを絡めたスキルで敵の自由を縛る。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 117501, 0, 3, "ミツキ（オーエド）", 117501, 11, 0, 552, 0, 2.4, 117501, 5, "みつき", "2030/12/31 15:00:00", 0, 5, 450, 0, "2021/09/03 19:00:00", 117501, "【物理】中衛で、戦況のすべてを見据える隻眼の闇医者。\nＨＰが低い敵を束縛し防御力ダウンスキルで仕掛けつつ\n呪詛の毎秒増加する継続ダメージで敵の命を刻々と蝕む。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 117601, 0, 3, "ユキ（オーエド）", 117601, 12, 0, 798, 0, 2.0, 117601, 7, "ゆき", "2030/12/31 15:00:00", 0, 7, 450, 0, "2021/09/13 12:00:00", 117601, "【魔法】後衛で、迷える皆を救う白衣を纏いし美の象徴。\n一番低い味方１キャラのＴＰを回復し、ＨＰ回復スキルで\n守り、魔法攻撃力アップのスキルで一気に攻め落とす。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 117701, 0, 3, "カオリ（ハロウィン）", 117701, 4, 1, 156, 0, 2.17, 117701, 1, "かおり", "2024/10/28 11:59:59", 0, 1, 450, 0, "2024/10/24 12:00:00", 117701, "【物理】前衛の敵を追い詰める程、力を増す幽玄南国娘。\n敵の体力が少ない程、効果が高まる攻撃力アップスキルと\nダメージ量アップの攻撃スキルで、敵を逃さず仕留める。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 117801, 0, 1, "ニノン（ハロウィン）", 117801, 12, 1, 518, 0, 2.25, 117801, 36, "にのん", "2030/12/31 15:00:00", 0, 36, 450, 0, "2023/07/18 15:00:00", 117801, "【物理】中衛で物理攻撃タイプの味方を強化するシノビ。\n味方の物理攻撃力アップや行動速度アップのスキル効果で\n味方全体の攻撃力を底上げし、勝利の笛を吹きならす。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 117901, 0, 3, "スズナ（ハロウィン）", 117901, 15, 0, 761, 0, 1.97, 117901, 8, "すずな", "2030/12/31 15:00:00", 0, 8, 450, 0, "2021/10/15 15:00:00", 117901, "【物理】後衛でアタッカーを狙う小悪魔カリスマモデル。\n誘惑状態だと威力アップの攻撃スキルや、ＴＰを奪い取る\n妨害スキルを放ち、物理攻撃力が最も高い敵を狙い撃つ。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 118001, 0, 3, "クレジッタ", 118001, 0, 1, 751, 0, 1.97, 118001, 35, "くれじった", "2024/09/30 11:59:59", 0, 35, 450, 0, "2024/09/25 12:00:00", 118001, "【物理】後衛で、攻撃と敵の弱体化の二役で輝く女商人。\n生ける金貨が詰まった財布を投げつける不意打ちや、\n金貨の嵐を巻き起こす攻撃で、相手の防御を大きく崩す。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 118101, 0, 3, "ランファ", 118101, 19, 1, 782, 0, 2.07, 118101, 21, "らんふぁ", "2025/05/03 18:59:59", 0, 7, 450, 0, "2025/04/30 12:00:00", 118101, "【魔法】後衛で、美しい旋律を紡ぎ支援する幽寂の歌姫。\n味方の強化と敵の弱体化の両方面での補助を行い、さらに\n召喚した鉱石の飛竜との波状攻撃により敵を鎮圧する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 118201, 0, 3, "ミソラ", 118201, 19, 1, 730, 0, 1.7, 118201, 0, "みそら", "2025/05/03 18:59:59", 0, 0, 450, 0, "2025/04/30 12:00:00", 118201, "【魔法】後衛で笑顔とともに破壊を振りまく溌溂少女★\n最大３体に着弾するスキルとＵＢは【PSI★チャージ】\n状態で魔防ダウン効果を追加し、邪魔者たちを殲滅する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (1, 0, 0, 118301, 180701, 3, "ハツネ（ハツネ&シオリ）", 118301, 0, 1, 732, 0, 0.0, 0, 0, "はつね", "2030/12/31 15:00:00", 0, 0, 0, 0, "2015/04/01 15:00:00", 0, "");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (1, 0, 0, 118401, 180701, 3, "シオリ（ハツネ&シオリ）", 118401, 0, 1, 732, 0, 0.0, 0, 0, "しおり", "2030/12/31 15:00:00", 0, 0, 0, 0, "2015/04/01 15:00:00", 0, "");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 118501, 0, 1, "カリン", 118501, 0, 1, 787, 0, 2.0, 118501, 37, "かりん", "2030/12/31 15:00:00", 0, 37, 450, 0, "2021/10/19 12:00:00", 118501, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 118601, 0, 3, "ネビア", 118601, 0, 1, 826, 0, 2.0, 118601, 0, "ねびあ", "2030/12/31 15:00:00", 0, 0, 450, 0, "2024/08/10 21:00:00", 118601, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 119001, 0, 3, "イオ（ノワール）", 119001, 15, 0, 714, 0, 2.27, 119001, 7, "いお", "2030/12/31 15:00:00", 0, 7, 450, 0, "2021/11/03 19:00:00", 119001, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 2, 0, 119101, 0, 3, "クウカ（ノワール）", 119101, 12, 0, 143, 0, 2.545, 119101, 26, "くうか", "2030/12/31 15:00:00", 0, 7, 450, 0, "2021/11/16 12:00:00", 119101, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 119201, 0, 1, "マヒル（クリスマス）", 119201, 5, 1, 397, 0, 2.19, 119201, 6, "まひる", "2030/12/31 15:00:00", 0, 6, 450, 0, "2023/09/19 15:00:00", 119201, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 119301, 0, 3, "リノ（クリスマス）", 119301, 6, 0, 762, 0, 1.97, 119301, 8, "りの", "2030/12/31 15:00:00", 0, 8, 450, 0, "2021/12/22 12:00:00", 119301, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。");
