INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 119901, 0, 3, "ミヤコ（クリスマス）", 119901, 14, 1, 302, 0, 2.17, 119901, 1, "みやこ", "2024/12/31 11:59:59", 0, 1, 450, 0, "2024/12/22 12:00:00", 119901, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 1, 0, 120001, 0, 3, "シズル（ノワール）", 120001, 6, 1, 190, 0, 2.375, 120001, 5, "しずる", "2025/03/15 14:59:59", 0, 5, 450, 0, "2025/03/10 12:00:00", 120001, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。");
INSERT INTO `v1_479e3c3fae60712a22965236dca94efb97b8cc21318b04309dd894100bb84b66` VALUES (0, 0, 0, 120101, 0, 3, "イオ（ノワール）", 120101, 0, 0, 0, 0, 0.0, 0, 7, "いお", "2030/12/31 15:00:00", 0, 7, 0, 0, "2015/04/01 15:00:00", 0, "");
